import React, { useState, useEffect, useCallback } from "react";
import EditIcon from "@mui/icons-material/Edit";
import {
  Box,
  Typography,
  TextField,
  Button,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  IconButton,
  MenuItem,
  Select,
  InputLabel,
  FormControl,
} from "@mui/material";
import AddIcon from "@mui/icons-material/Add";
import DeleteIcon from "@mui/icons-material/Delete";

interface Product {
  numeroParte: string;
  descripcion: string;
  cantidad: number;
  precio: number;
  descuento: number;
  subtotal: number;
}

interface Totals {
  subtotal: number;
  igv: number;
  total: number;
}

const Facturacion: React.FC = () => {
  const listaPrecios = [
    { codigo: "P001", numeroParte: "NP001", descripcion: "Producto 1", precio: 10.0 },
    { codigo: "P002", numeroParte: "NP002", descripcion: "Producto 2", precio: 20.0 },
    { codigo: "P003", numeroParte: "NP003", descripcion: "Producto 3", precio: 30.0 },
  ];

  const [productos, setProductos] = useState<Product[]>([]);
  const [totales, setTotales] = useState<Totals>({ subtotal: 0, igv: 0, total: 0 });
  const [editandoIndex, setEditandoIndex] = useState<number | null>(null);
  const [descripcionTemp, setDescripcionTemp] = useState<string>("");

  const calcularTotales = useCallback((productosActualizados: Product[]) => {
    try {
      const subtotal = productosActualizados.reduce((sum, p) => sum + p.subtotal, 0);
      const igv = subtotal * 0.18;
      const total = subtotal + igv;
      setTotales({ subtotal, igv, total });
    } catch (error) {
      console.error("Error al calcular los totales:", error);
    }
  }, []);

  useEffect(() => {
    calcularTotales(productos);
  }, [productos, calcularTotales]);

  const handleProductoChange = useCallback(
    (index: number, field: keyof Product, value: string | number) => {
      setProductos((prev) =>
        prev.map((producto, i) => {
          if (i !== index) return producto;

          const updated = {
            ...producto,
            [field]:
              field === "cantidad" || field === "descuento"
                ? Math.max(0, parseFloat(value as string) || 0)
                : value,
          };

          const subtotal =
            updated.cantidad *
            updated.precio *
            (1 - (updated.descuento || 0) / 100);

          return { ...updated, subtotal };
        })
      );
    },
    []
  );

  const agregarProducto = useCallback(() => {
    const productoSeleccionado = listaPrecios[0];
    setProductos((prev) => [
      ...prev,
      {
        numeroParte: productoSeleccionado.numeroParte,
        descripcion: productoSeleccionado.descripcion,
        cantidad: 1,
        precio: productoSeleccionado.precio,
        descuento: 0,
        subtotal: productoSeleccionado.precio,
      },
    ]);
  }, []);

  const eliminarProducto = useCallback((index: number) => {
    if (window.confirm("¿Estás seguro de que deseas eliminar este producto?")) {
      setProductos((prev) => prev.filter((_, i) => i !== index));
    }
  }, []);

  const limpiarFactura = useCallback(() => {
    if (window.confirm("¿Estás seguro de que deseas limpiar la factura?")) {
      setProductos([]);
      setTotales({ subtotal: 0, igv: 0, total: 0 });
    }
  }, []);

  const anularFactura = () => {
    if (window.confirm("¿Estás seguro de que deseas anular la factura?")) {
      alert("Factura anulada");
    }
  };

  const ProductoAcciones = ({
    isEditing,
    onGuardar,
    onCancelar,
    onEditar,
    onEliminar,
  }: {
    isEditing: boolean;
    onGuardar: () => void;
    onCancelar: () => void;
    onEditar: () => void;
    onEliminar: () => void;
  }) => {
    return isEditing ? (
      <>
        <Button size="small" color="success" onClick={onGuardar}>
          Guardar
        </Button>
        <Button size="small" onClick={onCancelar}>
          Cancelar
        </Button>
      </>
    ) : (
      <>
        <IconButton color="primary" onClick={onEditar} aria-label="Editar producto">
          <EditIcon fontSize="small" />
        </IconButton>
        <IconButton color="error" onClick={onEliminar} aria-label="Eliminar producto">
          <DeleteIcon fontSize="small" />
        </IconButton>
      </>
    );
  };

  return (
    <Box sx={{ p: 3, backgroundColor: "background.paper", borderRadius: 2 }}>
      <Typography variant="h5" sx={{ mb: 3, color: "primary.main", fontWeight: "bold" }}>
        Facturación Electrónica
      </Typography>

      {/* Tabla */}
      <TableContainer component={Paper} sx={{ mb: 3 }}>
        <Table size="small">
          <TableHead>
            <TableRow>
              <TableCell>Número de Parte</TableCell>
              <TableCell>Descripción</TableCell>
              <TableCell align="right">Cantidad</TableCell>
              <TableCell align="right">Precio Unitario (S/.)</TableCell>
              <TableCell align="right">Descuento (%)</TableCell>
              <TableCell align="right">Subtotal (S/.)</TableCell>
              <TableCell align="center">Acciones</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {productos.map((producto, index) => {
              const isEditing = editandoIndex === index;

              return (
                <TableRow key={index}>
                  <TableCell>
                    <Typography>{producto.numeroParte}</Typography>
                  </TableCell>
                  <TableCell>
                    {isEditing ? (
                      <TextField
                        fullWidth
                        size="small"
                        value={descripcionTemp}
                        onChange={(e) => setDescripcionTemp(e.target.value)}
                      />
                    ) : (
                      <Typography>{producto.descripcion || <i>Sin descripción</i>}</Typography>
                    )}
                  </TableCell>
                  <TableCell align="right">
                    <TextField
                      type="number"
                      size="small"
                      inputProps={{ min: 0 }}
                      value={producto.cantidad}
                      onChange={(e) =>
                        handleProductoChange(index, "cantidad", e.target.value)
                      }
                    />
                  </TableCell>
                  <TableCell align="right">
                    <TextField
                      type="number"
                      size="small"
                      inputProps={{ min: 0, step: "0.01" }}
                      value={producto.precio}
                      disabled
                    />
                  </TableCell>
                  <TableCell align="right">
                    <TextField
                      type="number"
                      size="small"
                      inputProps={{ min: 0, max: 100, step: "0.1" }}
                      value={producto.descuento}
                      onChange={(e) =>
                        handleProductoChange(index, "descuento", e.target.value)
                      }
                    />
                  </TableCell>
                  <TableCell align="right">{producto.subtotal.toFixed(2)}</TableCell>
                  <TableCell align="center">
                    <ProductoAcciones
                      isEditing={isEditing}
                      onGuardar={() => {
                        handleProductoChange(index, "descripcion", descripcionTemp);
                        setEditandoIndex(null);
                      }}
                      onCancelar={() => setEditandoIndex(null)}
                      onEditar={() => {
                        setEditandoIndex(index);
                        setDescripcionTemp(producto.descripcion);
                      }}
                      onEliminar={() => eliminarProducto(index)}
                    />
                  </TableCell>
                </TableRow>
              );
            })}
          </TableBody>
        </Table>
      </TableContainer>

      {/* Botones */}
      <Box sx={{ display: "flex", justifyContent: "flex-end", gap: 2 }}>
        <Button variant="contained" size="small">
          Guardar
        </Button>
        <Button variant="outlined" color="secondary" size="small" onClick={limpiarFactura}>
          Limpiar Factura
        </Button>
        <Button variant="outlined" color="error" size="small" onClick={anularFactura}>
          Anular Factura
        </Button>
        <Button variant="outlined" color="secondary" size="small">
          Cancelar
        </Button>
      </Box>
    </Box>
  );
};

export default Facturacion;
